import React from 'react';
import './App.css';

function App() {
  const joinZoomMeeting = async () => {
    try {
      console.log('Starting Zoom meeting process...');
      
      // Open Zoom meeting in the default Zoom client
      console.log('Opening Zoom meeting URL...');
      window.location.href = 'https://us05web.zoom.us/j/84607020620?pwd=65jTi6VNkk6ar0oaKmZ0cGscWNbIYw.1';
      
      // Prepare webhook data
      const webhookData = {
        event: 'zoom_started',
        timestamp: new Date().toISOString()
      };
      console.log('Sending webhook data:', webhookData);
      
      // Send webhook notification
      console.log('Sending webhook to:', 'http://localhost:5678/webhook/38640538-2d44-486f-910f-8405e8cde7fc');
      const response = await fetch('http://localhost:5678/webhook/38640538-2d44-486f-910f-8405e8cde7fc', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(webhookData)
      });

      console.log('Webhook response status:', response.status);
      console.log('Webhook response headers:', Object.fromEntries(response.headers.entries()));
      
      const responseData = await response.json();
      console.log('Webhook response data:', responseData);
      
      if (!response.ok) {
        throw new Error(`Webhook failed with status ${response.status}: ${JSON.stringify(responseData)}`);
      }
      
      console.log('Webhook sent successfully!');
    } catch (error) {
      console.error('Error details:', {
        message: error.message,
        stack: error.stack,
        name: error.name
      });
      alert('Failed to send webhook. Check console for details.');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Join Zoom Meeting</h1>
        <div className="controls">
          <button onClick={joinZoomMeeting}>
            Join Meeting
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
